import React from "react";
import styled from 'styled-components';

const Styles = styled.div`
	.footer {
		background-color: black;
	}

`;

function Footer() {
  return (
  <Styles>
    <div className="footer justify-content-center">
      <h1>This is footer</h1>
    </div>
   </Styles>
  );
}

export default Footer;
